jQuery(document).ready(function(e){e("button#deactivate_license_button").click(function(t){t.preventDefault(),molongui_swal({title:"Deactivate license",text:"Submit to deactivate your license now",icon:"info",closeOnEsc:!0,buttons:{cancel:{text:"No, cancel!",value:null,visible:!0,className:"",closeModal:!0},confirm:{text:"Yes, deactivate it!",value:!0,visible:!0,className:"",closeModal:!1}}}).then(t=>{t&&e.ajax({url:molongui_fw_params.ajax_url,type:"POST",data:{action:"deactivate_license_key",security:molongui_fw_params.ajax_nonce,form:e("form#molongui-settings-form").serializeArray()},success:function(t){var o=e.parseJSON(t);"success"===o[0]?molongui_swal({title:"Deactivated!",text:o[1],icon:"success"}).then(e=>{window.location.reload()}):molongui_swal({title:"Ooops... something weird happened!",text:o[1],icon:"error"})},error:function(e,t,o){molongui_swal("Ooops!","Something went wrong and the license has not been deactivated.","error")}})})})});